import React from 'react';
import Card from './Card'


const CardList = ({gundams}) => {

	return (
		 		<div>
					{
						gundams.map((user, i) => {
							return (
								<Card
								key={i}
								id={gundams[i].id}
								name={gundams[i].name}
								faction={gundams[i].faction}
								faction={gundams[i].faction}
								/>
								);
						})
					}
				</div>
		);
}

export default CardList;
